import{_ as e,a0 as a,a1 as r,a4 as h}from"./framework-786d5328.js";const d={},i=h('<h1 id="深度学习" tabindex="-1"><a class="header-anchor" href="#深度学习" aria-hidden="true">#</a> 深度学习</h1><h2 id="山君" tabindex="-1"><a class="header-anchor" href="#山君" aria-hidden="true">#</a> 山君</h2><ul><li><p>少量样本生成更多的测试样本</p></li><li><p>样本增强</p></li></ul><p>OCR生成、脏污生成、崩坏生成。。。。</p><p>核心原理：</p><p>标记缺陷=》标记产品=》生成样本</p><p>布尔工具、OCR</p><h2 id="机器学习" tabindex="-1"><a class="header-anchor" href="#机器学习" aria-hidden="true">#</a> 机器学习</h2><p>机器学习帮助我们去解决数据结构化的问题</p><h2 id="深度学习-1" tabindex="-1"><a class="header-anchor" href="#深度学习-1" aria-hidden="true">#</a> 深度学习</h2><p>深度学习是机器学习的一种高级形式，通过神经网络结构，可以更好的处理和理解复杂的数据。需要大量的数据和计算资源。</p><p>深度学习处理的不是结构化的数据，而是视频、图片、文本、语音</p><h3 id="神经网络" tabindex="-1"><a class="header-anchor" href="#神经网络" aria-hidden="true">#</a> 神经网络：</h3><p>人的大脑是由神经元组成的，两个神经元相连接就会形成一层网络。第一层网络和第二层网络可以连接，第二层网络也可以和第三层网络连接。以此下去，网络会越来越深。每一层网络之间都有一个连接键，连接键有一个强度；可以利用这些强度的组合，可以学习任意的函数，人工智能的很多应用，可以理解为一个函数，深度学习就是把这个函数学好。</p><p>神经网络训练本质上就是靠数据拟合出一个函数</p><p>卷积神经网络</p>',16),n=[i];function p(t,c){return a(),r("div",null,n)}const l=e(d,[["render",p],["__file","deep-learning.html.vue"]]);export{l as default};
